import React from 'react'
import "./card.css"

function Card(props) {
    console.log(props)
    const {backdrop_path, title, overview, release_date} = props.datosPelicula
    return(
        <div className='movie-card'>
            <img src={backdrop_path} />
            <h4>{title}</h4>
            <p> `https://image.tmdb.org/t/p/w342/ ${overview}`</p>
            <p>{release_date}</p>
        </div>
    )
}

export default Card;
